import React from 'react';
import ReactDOM  from 'react-dom/client';
import { resturantlist } from './Config';



  const ResturantCard = ({name , category, price}) => {
    return(
      <div className='card'>
        <img src='https://res.cloudinary.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_508,h_320,c_fill/9b0328e05e8cb535d744b6ab406c8e18'/>
        {/* <h2>{props.resturant.info?.name}</h2> */} {/* without destructing  */}
        <h2>{name}</h2>
        <h3>{category}</h3>
        <h4>{price}</h4>
      </div>
    );
  }

  const Body =() =>{
    return(
    <div className='resturant-list'>
      {resturantlist.map((resturant) => {
        return <ResturantCard {...resturant.info} key = {resturant.info.id}/>
      })}
    </div>
    )
  }

  export default Body;
